package org.xmldap.xmldsig;

import java.security.cert.X509Certificate;
import java.security.interfaces.RSAPrivateKey;
import java.util.ArrayList;
import java.util.List;

import org.xmldap.exceptions.SerializationException;
import org.xmldap.infocard.InfoCard;
import org.xmldap.infocard.policy.SupportedClaim;
import org.xmldap.infocard.policy.SupportedClaimList;
import org.xmldap.infocard.policy.SupportedToken;
import org.xmldap.infocard.policy.SupportedTokenList;
import org.xmldap.ws.WSConstants;

import sun.security.x509.X509Cert;

import junit.framework.TestCase;

public class InfoCardSignatureTest extends TestCase {
	InfoCard card = null;

	protected void setUp() throws Exception {
		super.setUp();

		X509Certificate signingCert = org.xmldap.util.XmldapCertsAndKeys.getXmldapCert();
		RSAPrivateKey privateKey = org.xmldap.util.XmldapCertsAndKeys.getXmldapPrivateKey();
		X509Certificate[] certChain = {signingCert};
		
		card = new InfoCard(certChain, privateKey);

        card.setCardId("card1", 1);
		card.setIssuer("issuer");
		card.setTimeIssued("2006-09-28T12:58:26Z");
		{
			SupportedClaimList claimList = new SupportedClaimList();
			String displayName = "displayName";
			String uri = "uri";
			String description = "description";
			SupportedClaim claim = new SupportedClaim(displayName, uri, description);
			claimList.addSupportedClaim(claim);
			card.setClaimList(claimList);
		}
		{
			SupportedToken token = new SupportedToken(WSConstants.SAML11_NAMESPACE); // default is SAML11
			List<SupportedToken> list = new ArrayList<SupportedToken>();
			list.add(token);
			SupportedTokenList tokenList = new SupportedTokenList(list);
			card.setTokenList(tokenList);
		}

	}

	public void testSignature() throws SerializationException {
		String signedCard = card.toXML();
		String expectedSignature = "<dsig:Signature xmlns:dsig=\"http://www.w3.org/2000/09/xmldsig#\"><dsig:SignedInfo><dsig:CanonicalizationMethod Algorithm=\"http://www.w3.org/2001/10/xml-exc-c14n#\" /><dsig:SignatureMethod Algorithm=\"http://www.w3.org/2000/09/xmldsig#rsa-sha1\" /><dsig:Reference URI=\"#_Object_InfoCard\"><dsig:Transforms><dsig:Transform Algorithm=\"http://www.w3.org/2001/10/xml-exc-c14n#\" /></dsig:Transforms><dsig:DigestMethod Algorithm=\"http://www.w3.org/2000/09/xmldsig#sha1\" /><dsig:DigestValue>EcTzA0+sqGVzuRdXiF0CpdIT+Lo=</dsig:DigestValue></dsig:Reference></dsig:SignedInfo><dsig:SignatureValue></dsig:SignatureValue><dsig:KeyInfo><dsig:X509Data><dsig:X509Certificate></dsig:X509Certificate></dsig:X509Data></dsig:KeyInfo><dsig:Object Id=\"_Object_InfoCard\"><ic:InformationCard xmlns:ds=\"http://www.w3.org/2000/09/xmldsig#\" xmlns:ic=\"http://schemas.xmlsoap.org/ws/2005/05/identity\" xmlns:mex=\"http://schemas.xmlsoap.org/ws/2004/09/mex\" xmlns:wsa=\"http://www.w3.org/2005/08/addressing\" xmlns:wsid=\"http://schemas.xmlsoap.org/ws/2006/02/addressingidentity\" xmlns:wst=\"http://schemas.xmlsoap.org/ws/2005/02/trust\" xml:lang=\"en-us\"><ic:InformationCardReference><ic:CardId>card1</ic:CardId><ic:CardVersion>1</ic:CardVersion></ic:InformationCardReference><ic:CardImage MimeType=\"image/png\"></ic:CardImage><ic:Issuer>issuer</ic:Issuer><ic:TimeIssued>2006-09-28T12:58:26Z</ic:TimeIssued><ic:TimeExpires>9999-12-31T23:59:59.9999999Z</ic:TimeExpires><ic:SupportedTokenTypeList><wst:TokenType>urn:oasis:names:tc:SAML:1.0:assertion</wst:TokenType></ic:SupportedTokenTypeList><ic:SupportedClaimTypeList><ic:SupportedClaimType Uri=\"uri\"><ic:DisplayTag>displayName</ic:DisplayTag><ic:Description>description</ic:Description></ic:SupportedClaimType></ic:SupportedClaimTypeList></ic:InformationCard></dsig:Object></dsig:Signature>";
		assertEquals(expectedSignature, signedCard);
	}
}
